pragma solidity ^0.4.24;

contract TestHash {
  function getKeccak(string _str) public pure returns (bytes32){
    return keccak256(abi.encodePacked(_str));
  }
  function getKeccak(bytes32 _b) public pure returns(bytes32){
      return keccak256(abi.encodePacked(_b));
  }
  function getKeccak2(bytes32 _a,bytes32 _b) public pure returns(bytes32){
      string memory a=bytes32ToString(_a);
      string memory b=bytes32ToString(_b);
      string memory c=strConcat(a,b);
      bytes32 d=stringToBytes32(c);
      return keccak256(abi.encodePacked(d));
  }
   function getKeccak2(string _a,string _b) public pure returns(bytes32){
      return keccak256(abi.encodePacked(_a,_b));
  }
  function compareByte(bytes32 _h,bytes32 _s) internal pure returns(bool){
        for(uint i = 0;i<32;i++){
            if(_s[i]!=_h[i]){
                return false;
            }
        }
        return true;
    }

  function strConcat(string _a,string _b) internal pure returns (string) {
        bytes memory bytes_a = bytes(_a);
        bytes memory bytes_b = bytes(_b);
        string memory length_ab = new string(bytes_a.length + bytes_b.length);
        bytes memory bytes_c = bytes(length_ab);
        uint k = 0;
        for (uint i = 0; i < bytes_a.length; i++) {bytes_c[k++] = bytes_a[i];}
        for (i = 0; i < bytes_b.length; i++) {bytes_c[k++] = bytes_b[i];}
        return string(bytes_c);
    }
  function bytes32ToString(bytes32 x) internal pure returns (string) {
        bytes memory bytesString = new bytes(32);
        uint charCount = 0;
        for (uint j = 0; j < 32; j++) {
            byte char = byte(bytes32(uint(x) * 2 ** (8 * j)));
            if (char != 0) {
                bytesString[charCount] = char;
                charCount++;
            }
        }
        bytes memory bytesStringTrimmed = new bytes(charCount);
        for (j = 0; j < charCount; j++) {
            bytesStringTrimmed[j] = bytesString[j];
        }
        return string(bytesStringTrimmed);
    }
  function stringToBytes32(string memory source) internal pure returns (bytes32 result) {
      bytes memory tempEmptyStringTest = bytes(source);
      if (tempEmptyStringTest.length == 0) {
          return 0x0;
      }
      assembly {
          result := mload(add(source, 32))
      }
  }
}
